import React, { Component } from 'react';
import cloudinary from 'cloudinary-core'


class EditProduct extends Component {
    constructor(props) {
        super(props)
        this.upload = this.upload.bind(this);
    }

    upload() {
        console.log('clicked');
        cloudinary.config({
            cloud_name: 'muhalik',
            api_key: '338681537599526',
            api_secret: 'Wbh8OoYjgpS6RNohplZaVFanuUc'
        });
        cloudinary.uploader.upload(
            "https://www.google.com.pr/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png",
            function (result) {
                console.log(result)
            }
        )
    }

    checkUploadResult = (resuktEvent) => {
        if(resuktEvent.event == 'success'){
            console.log('Fuck you Good')
        }
    }
    showWidget= (widget) => {
        widget.open();
    }
    render() {
        var widget = window.cloudinary.createUploadWidget({
            cloudName: '',
            uploadPreset: ''
        },
            (error, result) => {
                this.checkUploadResult(result)
             }
        )
        return (
            <>
                <head>
                    <script src="http://widget.cloudinary.com/v2.0/global/all.js" type="text/javascript" />
                </head>
                <div>
                    <button onClick={this.showWidget}>Upload</button>
                </div>
            </>
        );
    }
}

export default EditProduct;
